import ExpenseItem from "./ExpenseItem";

export default function Expenses(props) {
    return (
        <div>
            <ExpenseItem title={props.items[0].title} amount={expenses[0].amount} date={expenses[0].date} />
            <ExpenseItem title={props.items[1].title} amount={expenses[1].amount} date={expenses[1].date} />
            <ExpenseItem title={props.items[2].title} amount={expenses[2].amount} date={expenses[2].date} />
            <ExpenseItem title={props.items[3].title} amount={expenses[3].amount} date={expenses[3].date} />
        </div>
    )
}
